    private int lengthOfLongestSubstringSlidingWindow(final String s){
        //"abba"
        Map<Character, Integer> charLastIndex = new HashMap<>();
        int left = 0;
        int right =0;
        int result = 0;
         while(right < s.length()) {

             if (charLastIndex.get(s.charAt(right)) != null ) {
                 left = Math.max(left, charLastIndex.get(s.charAt(right)) + 1);
             }
             charLastIndex.put(s.charAt(right), right);
             result = Math.max(result, right - left + 1);
             right++;
         }
         return result;
    }
